import React from "react";
import ReactDOM from  "react-dom";

class Mest extends React.Component{

    constructor(){

        super()
        this.state={
            say:"Hello world"
        }
        this.setStateHandler=this.setStateHandler.bind(this);
    }

    setStateHandler() {
        this.setState({say:"Yeah"})
    }

    render() {
        return (<div><button onClick={this.setStateHandler} value="State"/><div>{this.state.say}</div></div>);

    }

}
